/// <reference types="cypress" />
/* eslint-env mocha */
/* global cy expect Cypress */

import data from '../../db';

const photo = data.photos[3];
const photoCount = 2;
const photoToDelete = data.photos[1];
const newPhoto = {
  id: '1',
  name: 'rainbow',
  upload_date: '20/10/2020',
  image: "data:image/jpeg;base64,"
};

const port = Cypress.env('port');
const url = `http://localhost:${port}`;

const resetData = () => cy.request('POST', `${url}/api/reset`, data);

const containsPhotos = count =>
  cy.get('.list .name').should('have.length', count);

const detailsAreVisible = visible => {
  const val = visible ? '' : 'not.';
  // return cy.get('.edit-detail input[name=name]').should(`${val}be.visible`)
  return cy.get('.edit-detail input[name=name]').should(`${val}exist`);
};

context('Photos', () => {
  beforeEach(() => {
    resetData().then(() => {
      cy.visit(url);
      cy.get('nav ul.menu-list a')
        .contains('Photos')
        .click();
    });
  });

  after(() => resetData());

  specify(`Contains ${photo.name}`, () => {
    cy.get('.list .name').contains(photo.name);
  });

  specify('Contains 2 photos', () => {
    containsPhotos(photoCount);
  });

  specify(`Deletes ${photoToDelete.name}`, () => {
    cy.get(`.list .delete-item[data-id=${photoToDelete.id}]`).click();

    cy.get(`.modal-photo .modal-yes`).click();

    containsPhotos(photoCount - 1);
    cy.get(`.list .delete-item[data-id=${photoToDelete.id}]`).should(
      'not.exist'
    );
  });

  context(`${photo.name} has been Selected`, () => {
    beforeEach(() => {
      cy.get(`.list .edit-item[data-id=${photo.id}]`).click();
    });

    specify(`Shows Details for ${photo.name}`, () => {
      const match = new RegExp(photo.id);
      detailsAreVisible(true);
      cy.get('.edit-detail input[name=id]')
        .invoke('val')
        .should('match', match);
    });

    specify(`Photo List is gone`, () => {
      containsPhotos(0);
      cy.get(`.list .delete-item[data-id=${photoToDelete.id}]`).should(
        'not.exist'
      );
      cy.get(`.list .delete-item[data-id=${photo.id}]`).should('not.exist');
    });

    specify(`Saves changes to ${photo.name}`, () => {
      const newUploadDate = 'slayer of javascript';
      detailsAreVisible(true);
      cy.get('.edit-detail input[name=upload_date]')
        .clear()
        .type(newUploadDate);
      cy.get('.edit-detail input[name=upload_date]')
        .invoke('val')
        .should('not.match', new RegExp(photo.upload_date))
        .and('match', new RegExp(newUploadDate));
      cy.get('.edit-detail .save-button').click();
      detailsAreVisible(false);
      cy.get('.list .upload_date').contains(newUploadDate);
      containsPhotos(photoCount);
    });

    specify(`Cancels changes to ${photo.name}`, () => {
      const newUploadDate = 'slayer of javascript';
      detailsAreVisible(true);
      cy.get('.edit-detail input[name=upload_date]')
        .clear()
        .type(newUploadDate);
      cy.get('.edit-detail input[name=upload_date]')
        .invoke('val')
        .should('not.match', new RegExp(photo.upload_date))
        .and('match', new RegExp(newUploadDate));
      cy.get('.edit-detail .cancel-button').click();
      detailsAreVisible(false);
      cy.get('.list .upload_date').contains(photo.upload_date);
      containsPhotos(photoCount);
    });
  });

  context(`Add New Photo`, () => {
    beforeEach(() => {
      cy.get('.content-container .add-button').click();
    });

    specify(`Saves changes to ${newPhoto.name}`, () => {
      detailsAreVisible(true);
      cy.get('.edit-detail input[name=name]')
        .clear()
        .type(newPhoto.name);
      cy.get('.edit-detail input[name=upload_date]')
        .clear()
        .type(newPhoto.upload_date);
      cy.get('.edit-detail .save-button').click();
      detailsAreVisible(false);
      cy.get('.list .upload_date').contains(newPhoto.upload_date);
      containsPhotos(photoCount + 1);
    });
  });

  context(`Direct Routing`, () => {
    specify(`Routes to /photos directly and see photo list`, () => {
      cy.visit(url);
      cy.wait(1000);
      cy.location().should(loc => {
        expect(loc.host).to.eq(`localhost:${port}`);
        expect(loc.hostname).to.eq('localhost');
        expect(loc.href).to.eq(`${url}/photos`);
        expect(loc.origin).to.eq(url);
        expect(loc.port).to.eq(port);
        expect(loc.protocol).to.eq('http:');
        expect(loc.toString()).to.eq(`${url}/photos`);
      });
      detailsAreVisible(false);
      containsPhotos(photoCount);
    });
  });
});
